pragma solidity ^0.8.0;

import "/ds-auth/auth.sol";
import "/ds-note/note.sol";

contract DSStop is DSNote, DSAuth {

    bool public stopped;

    modifier stoppable {
        require(!stopped);
        _;
    }
    function stop() public payable auth note {
        stopped = true;
    }
    function start() public payable auth note {
        stopped = false;
    }

}

